import React from 'react'
import axios from 'axios'
export default class Homepage extends React.Component {
    constructor(props){
        super(props);
        this.state = {

            data: [],
            loading: false,
        };

    }
    componentDidMount(){
    // Simple GET request using fetch
        const loading = true;
    axios.get('http://127.0.0.1:5000/')
        .then(response => {
            console.log(response.data)
            this.setState({
                data: response.data,

            })
        })
        .catch(error => {
            console.log(error)
        });

    }
    render() {
        const { data } = this.state

        return (
            <ul>

                Naruto:

                {JSON.stringify(data['Naruto'])}

                {JSON.stringify(data['Naruto']).map(
                    data['Naruto'], index => (<li key={index}>{data['Naruto']} </li>)
                )}

            </ul>
        )
    }
}
